The model will use a relative gain term, which calculates the difference between the participant's share relative to their contribution and the opponent's share relative to their contribution. This relative gain is weighted by a learnable parameter.  The model will also include a term reflecting the sensitivity to the ratio of the participant's share to their pre-task contribution, weighting this against the opponent’s share relative to their contribution, capturing whether the offer is above or below an expectation set by the token-finding task. This will be weighted by a second learnable parameter.


